import SwiftUI

struct WaveFormView: View {
	
	var waveFormL: [CGFloat]
	var waveFormR: [CGFloat]
	var isStroke: Bool
	
	var body: some View {
		GeometryReader { geo in
			
			let height = geo.size.height / 2
			
			let divider: CGFloat = 5
			
			let width = geo.size.width
			let chartwidth = width / CGFloat(waveFormL.count)
			
			
			VStack(spacing: 0) {
				Spacer()
				if isStroke {
					Path { path in
						path.move(to: CGPoint(x: 0, y: height))
						
						for ( index , value ) in waveFormL.enumerated() {
							
							let log = pow(10, value / divider)
							
							
							path.addLine(to: CGPoint(x: CGFloat(index) * chartwidth , y: -(log * height) ))
							}
						path.addLine(to: CGPoint(x: width, y: height))
						
						
					}
					.stroke(Color.white)
				} else {
					Path { path in
						path.move(to: CGPoint(x: 0, y: height))
						
						for ( index , value ) in waveFormL.enumerated() {
							
							let log = pow(10, value / divider)
							
							path.addLine(to: CGPoint(x: CGFloat(index) * chartwidth , y: -(log * height) ))
							}
						path.addLine(to: CGPoint(x: width, y: height))
						
						
					}
				}
				
				
					
				
				
				Group {
					if isStroke {
						Path { path in
							path.move(to: CGPoint(x: 0, y: height))
							
							for ( index , value ) in waveFormR.enumerated() {
								
								let log = pow(10, value / divider)
								
								path.addLine(to: CGPoint(x: CGFloat(index) * chartwidth , y: -(log * height) ))
								}
							path.addLine(to: CGPoint(x: width, y: height))
							
							
						}
						.stroke(Color.white)
					} else {
						Path { path in
							path.move(to: CGPoint(x: 0, y: height))
							
							for ( index , value ) in waveFormR.enumerated() {
								
								let log = pow(10, value / divider)
								
								path.addLine(to: CGPoint(x: CGFloat(index) * chartwidth , y: -(log * height) ))
								}
							path.addLine(to: CGPoint(x: width, y: height))
							
							
						}
						
					}
					
					
				}
				.scaleEffect(x: 1, y: -1)
				
				
				
			
				

				Spacer()
			}
			
			
		}
		.allowsHitTesting(false)
		.ignoresSafeArea()
		.scaleEffect(x: 1, y: 0.6)
//		.scaleEffect(1)
	}
	init(waveFormL: [CGFloat], waveFormR: [CGFloat], isStroke: Bool) {
		self.waveFormL = waveFormL
		self.waveFormR = waveFormR
		self.isStroke = isStroke
	}
}

